        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>item</Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>item</Paper>
        </Grid>
      </React.Fragment>
    );
  }
    render()
    {
        return (
            <Grid container spacing={1}>
            <Grid container item xs={12} spacing={3}>
              FormRow();
            </Grid>
            <Grid container item xs={12} spacing={3}>
            FormRow();
            </Grid>
            <Grid container item xs={12} spacing={3}>
            FormRow();
            </Grid>
          </Grid>)        
    }

}

export default Memory;
